import React, {Component} from "react"


class MenuRow extends Component{
    constructor(props){
        super(props);
        this.state = {
            hover: true,
            backgroundColor: "#222",
            color: "white",
        };
    }

    hover = () => {
        this.setState({
            hover: true,
            backgroundColor: "#444",
            color: "red",
        });
    };
    notHover = () => {
        this.setState({
            hover: true,
            backgroundColor: "#222",
            color: "white",
        });
    };



    render() {
        return(
            <div className="row"
                 onMouseOver ={this.hover}
                 onMouseLeave={this.notHover}
                 style={this.state}>
                <h3 className="rowName">Row 1</h3>
            </div>
        )
    }
}
export default MenuRow;
